With this app YOU CAN'T WATCH TV SHOWS OR MOVIES

MovieDiary will help you track and manage your movies Watchlist and store the history of watched movies in the one comfortable place.

Features:
- Track and discover Movies and TV Shows;
- Add Movies and TV Shows to your watchlist and manage them easily;
- Use Application without Authorization and user creation;
- Explore lists with popular, top rated and trending Movies or TV Shows;
- Create your personal Movies Lists;
- Synchronize between all your android devices;
- Filter your items by genre, type (movie or TV show), your score, viewing date;
- Find out Movies and TV Shows detailes: release date, duration, director, actors, description, tagline, MovieDiary user rating, Imdb rating, genres, etc .;
- Search for movies in the MovieDiary database in English, German and Russian;
- Choose from different themes;



With Movie Diary you will never lose any Movie or TV show.



You realy need MovieDiary if you are one of those who:

- Loves good movies and TV shows;
- Keeps your Watchlist in notes, notebook, messenger, etc;
- Sometimes can't quickly remember what awesome you have watched recently or what to recommend to friends.
